import React from 'react';
import TextField from './components/TextField/TextField';
import './Bmi.css';
import InputField from './components/InputField/InputField';


function Bmi(){
  return (
    <div className='container'>
    <TextField 
    textVal="BMI Tracker" 
    styleClass="text-field"
    />

    <InputField 
    inputType="number"
    styleClass="input-field" 
    labelText= "Weight"
    />
    <InputField 
    inputType="number"
    styleClass="input-field" 
    labelText= "Height"
    />
    </div>
  );
}

export default Bmi;
